企业及小区提供热力供应服务，为新三板上市的高新技术企业，经营地址位于北京市石景山区鲁谷路，下设库房和两个子公司，库房位于西五环衙门口桥西北，子公司一为内蒙古某环保技术有限公司，子公司二为北京某能源管理有限公司。公司主营业务包括热力供应及配套的设备建造和安装服务（供暖设备的安装调试、供热管或供气管道等外转设施的铺设、供暖系统的整体建筑安装等）、后期升级维修等，经统计当前供暖24个小区，面积合计391万平米，期限多为20年。就目前经营情况来看，公司经营状况良好，行业稳定，且本次借款主要用于补充流动资金，用途明确，营业收入稳定、可靠，还款有保证，与此同时实际控制人潘某，已婚已育，家庭稳定性较好，名下有房产1套，公司名下有车辆14部，财产保障能力优，历史信用记录良好。 原始债权人已经将相应借款金额支付给该借款企业，并扣除借款金额的20%作为风险保证金，投资人可以支付相应金额购买债权。','北京某环保技术股份有限公司','2001-04-02 03:02:31','北京市','7331.43','14000','补充流动资金','营业收入','该公司主要提供热力供应服务，为新三板上市的高新技术企业，提供了企业证件以及建筑企业资质证书、特种设备安装改造维修许可证（锅炉、压力管道）和安全生产许可证等证书，经营地址位于北京市石景山区鲁谷路，下设库房和两个子公司，库房位于西五环衙门口桥西北，子公司一为内蒙古某环保技术有限公司，子公司二为北京某能源管理有限公司。公司主要从事供暖工程建造、供暖设备销售以及供暖项目BOT运营，工程建造缴纳营业税，供暖设备销售及供暖BOT项目建成后收取的供暖费，公司现阶段收费物业项目24个，主要系北京金隅嘉业房地产公司开发的项目：包括金隅美和园、金隅可乐、金隅康惠园、金隅景和园、金隅滨和园等多个项目，面积合计391万平米，期限多为20年。经外访人员实勘经营地址、库房、公司完税凭证以及对公账户银行流水等，企业经营稳定，经审计的财务报表显示2012和2013年营业收入分别为1.05亿元及1.42亿元，经营业务真实，银行流水稳定。','&lt;span&gt;经审计的财务报表显示2012和2013年营业收入分别为1.05亿元及1.42亿元，&lt;/span&gt;&lt;span style=&quot;line-height:1.5;&quot;&gt;企业近半年月均营业额约1184万，年营业额约&lt;/span&gt;&lt;span style=&quot;line-height:1.5;&quot;&gt;1.4&lt;/span&gt;&lt;span style=&quot;line-height:1.5;&quot;&gt;亿。&lt;/span&gt;',1,46,'北京市海淀区','北京市海淀区','已婚，育有一女，家庭稳定性较好','潘某，北京人，祖籍安徽，名下有房产1套，公司名下有车辆14部，财产保障能力优','经查询在人民银行征信记录良好，在人民法院暂无被执行记录','根据全国法院被执行人信息查询系统、全国法院失信被执行人名单信息公布与查询平台及互联网搜索，未发现借款人涉诉信息。','{\"license\":\"on\",\"tax_authority\":\"on\",\"organization_code\":\"on\",\"bank_account_cert\":\"on\",\"company_rule\":\"on\",\"capital_verified_report\":\"on\",\"qualification\":\"on\",\"representative\":\"on\",\"controller\":\"on\",\"premise\":\"on\",\"residence\":\"on\",\"business_info\":\"on\",\"house_property\":\"on\",\"car\":\"on\",\"onsite\":\"on\",\"other\":\"on\"}','企业实际控制人和共同借款人提供连带责任担保','1、借款企业融资成功后已交纳20%作为履约保证金&lt;/br&gt;\r\n2、九斗鱼累计计提1%的风险准备金代偿&lt;/br&gt;\r\n3、唯达信用担保（北京）有限公司提供连带责任担保&lt;/br&gt;\r\n4、耀盛商业保理有限公司当日无条件回购','&lt;img src=&quot;http://mc.9douyu.com/picture/1688&quot; width=&quot;165&quot; height=&quot;107&quot; alt=&quot;企业法人营业执照&quot; /&gt